#nullable enable // autogenerated

using PVZEngine;
using UnityEngine;

namespace MVZ2.Models
{
    public class ModelInitializer : MonoBehaviour
    {
        void Awake()
        {
            if (model)
            {
                model.Init(modelID, modelCamera);
            }
        }

        public Model model;
        public NamespaceID modelID;
        public Camera modelCamera;
    }
}
